import React from 'react';

function Player() {
    return (
      <div className="App">
        <header className="App-header">

          <p>
            Hello Edit <code>src/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
  }

  export default Player;
